import React from 'react';
import Link from 'next/link';
import { Button } from 'antd';


const Buttons = () => {
  return (
    <>
      <Button type="primary" style={{width: '500px', marginTop: '50px', height: '100px', backgroundColor:'#E6FFFF', borderColor: '#0366d6', borderRadius: '10px', color: 'black'}}>
        <a href="https://opentutorials.org/course/1" target="_blank">
          생활코딩<br></br>
          생활코딩은 일반인들에게 프로그래밍을 알려주는 무료 온라인, 오프라인 수업입니다. 
          </a>
      </Button>
    </>
  )
}


export default Buttons;
